أنت جبل يحوي بداخله بركان من الشجاعة وغار  من الالماس إن شئتِ … أو مستنقع من الطين إن شئتِ

أنت نور الشمس الذي يعمي الأبصار إن شئتِ … وظلام مقرف كئيب إن شئتِ

قد أنعم الله عليك بنعمة العقل .. وبيدكِ أنت القرار

أنتِ من تحدد موقعها بين الناس
أنتِ من تقرر مستواها بين الخلق
أنتِ سبب سعادتكِ أو حزنك

أنتِ من تختار سبل المضي في الحياة ... شامخة إن شئتِ ... أو بين الأقدام إن شئتِ

وان حالت بك الأحوال .. واصبحت أسيرة الظروف .. أنتِ من يقرر كسر القيد أو الامتثال له

لكل منا نصيبها من الأحزان … ولكل منا لحظات تحتاج أن تكون فيها ضعيفًة أمام جراحاتها …ولكن العبرة فيما بعد ذلك

أنتِ من تحدد مدة الحزن ومداه، وأنتِ من تقرر النهوض منه إن شئتِ .. أو الغرق في وحل التعاسة إن شئتِ

عزيزتي،

ثقي تماما ... بعد الله
أنت أقوى سند لك .. وأنتِ من تحدد مدى قوّتكِ .. إن شئتِ

ناهيناز

